    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "N\u00e4r en ny tj\u00e4nstetunnel skapas eller en tj\u00e4nst k\u00f6rs f\u00f6r f\u00f6rsta g\u00e5ngen (t.ex. standardverktyg f\u00f6r webbservern, plugin-program), skapas en privat krypteringsnyckel som i grunden kontrollerar \u00e4gandet av adressen. Den h\u00e4r \u00e4r vanligtvis namngiven <code>&hellip;privKey.dat</code> eller <code>eepPriv.dat</code>, men det \u00e4r en bra id\u00e9 att \u00e4ndra namnet f\u00f6r att ange den tj\u00e4nst den tillh\u00f6r, och sedan ange det igen i inst\u00e4llningarna f\u00f6r Tunnel Manager-servern. Denna .dat-fil b\u00f6r s\u00e4kerhetskopieras p\u00e5 ett s\u00e4kert s\u00e4tt; f\u00f6rlorar du den s\u00e5 f\u00f6rlorar du \u00e4gandet och kontrollen \u00f6ver din v\u00e4rdnamn!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Denna inst\u00e4llning till\u00e5ter konfiguration av det maximala antalet filer per torrent som I2PSnark kommer att till\u00e5ta vid nedladdning eller skapande av en torrent. Observera att en betydande \u00f6kning av detta v\u00e4rde fr\u00e5n standardv\u00e4rdet p\u00e5 2000 filer kan kr\u00e4va ytterligare konfiguration p\u00e5 v\u00e4rdsystemet f\u00f6r att \u00f6ka det maximala antalet \u00f6ppna filer som operativsystemet till\u00e5ter (t.ex. <code> ulimit -n </code> p\u00e5 Linux). F\u00f6r att \u00e4ndra detta l\u00e4gger du till i I2PSnarks konfigurationsfil <code> i2psnark.config </code>. [Omplacering av I2PSnark eller router kr\u00e4vs]";
