    t[555] = "V\u00e4lj ett namn f\u00f6r din webbplats (<i>hostname</i>.i2p), med sm\u00e5 bokst\u00e4ver. F\u00f6r att verifiera att v\u00e4rdnamnet \u00e4r tillg\u00e4ngligt, kontrollera <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> eller <a href=http://reg.i2p target=_blank>reg.i2p</a> innan du best\u00e4mmer dig. Ange det nya namnet f\u00f6r din webbplats p\u00e5 <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> d\u00e4r det st\u00e5r <i>Website name</i>, genom att ers\u00e4tta standardv\u00e4rdet <i>mysite.i2p</i>. Om du vill att din webbplats ska vara tillg\u00e4nglig n\u00e4r I2P startar, aktivera <i>Auto Start</i> och klicka sedan p\u00e5 <i>Save</i>.";
