    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "\u00c4ven om I2P kommer att fungera bra i denna konfiguration. Men om du verkligen har mer \u00e4n 128 kbit/s bandbredd f\u00f6r att dela, kommer det att vara mycket mer anv\u00e4ndbart f\u00f6r n\u00e4tverket om du \u00f6ppnar din brandv\u00e4gg.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Eepget \u00e4r ett kommandoradsprogram som medf\u00f6ljer I2P och anv\u00e4nds f\u00f6r att beg\u00e4ra URL-resurser, liknande <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> eller <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget anv\u00e4nds ocks\u00e5 internt av routern, till exempel f\u00f6r att fylla p\u00e5 med data fr\u00e5n fj\u00e4rrv\u00e4rdar. Som standard anv\u00e4nder eepget HTTP-proxyservern p\u00e5 <code>127.0.0.1:4444</code>.";
