    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "En eepsite \u00e4r en webbplats som \u00e4r v\u00e4rd anonymt p\u00e5 I2P-n\u00e4tverket - du kan komma \u00e5t den genom att konfigurera din webbl\u00e4sare f\u00f6r att anv\u00e4nda I2P:s HTTP-proxy (se ovan) och bl\u00e4ddra till webbplatsen med suffixet <code>.i2p</code> (t.ex. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Se ocks\u00e5 till att din webbl\u00e4sare \u00e4r konfigurerad att l\u00f6sa DNS fj\u00e4rrstyrt n\u00e4r du anv\u00e4nder proxyn f\u00f6r att undvika DNS-l\u00e4ckor.";
