    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Det f\u00f6rsta numret \u00e4r antalet likst\u00e4llda som din router har skickat eller tagit emot meddelanden fr\u00e5n de senaste minuterna. Detta kan variera fr\u00e5n 8-10 till flera hundra, beroende p\u00e5 din totala bandbredd, delad bandbredd och lokalt genererad trafik. Det andra numret \u00e4r antalet likst\u00e4llda som setts under den senaste timmen ungef\u00e4r. Var inte orolig om dessa siffror varierar kraftigt. <a href='/configstats#router.activePeers'>[Aktivera grafer]</a>.";
