    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Din webserver k\u00f6rs som standard p\u00e5 <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, men \u00e4r inte tillg\u00e4nglig f\u00f6r andra f\u00f6rr\u00e4n du startar tunneln <i>I2P Webserver</i>. Efter att du har startat tunneln, kommer det att vara sv\u00e5rt f\u00f6r andra att hitta din webbplats. Du kan bara ber\u00e4tta f\u00f6r m\u00e4nniskor destinationen eller Base32-adressen, men som tur \u00e4r har I2P en adressbok f\u00f6r att lagra dom\u00e4nnamn och olika tj\u00e4nster d\u00e4r du kan <a href=/help/hostnameregistration>registrera en ny .i2p-dom\u00e4n</a> gratis.";
