    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Avvikelsen (offset) f\u00f6r din dators klocka i f\u00f6rh\u00e5llande till den tid n\u00e4tverket synkroniserat till (om det \u00e4r k\u00e4nt). I2P kr\u00e4ver att din dators tid \u00e4r korrekt. Om avvikelsen \u00e4r mer \u00e4n n\u00e5gra sekunder, v\u00e4nligen korrigera problemet genom att justera din dators tid. Om I2P inte kan ansluta till internet kan en l\u00e4shastighet p\u00e5 0 ms indikeras. Observera: Detta visas endast i avsnittet <i>Router Information (advanced)</i>. Du kan l\u00e4gga till det h\u00e4r avsnittet i ditt sidof\u00e4lt p\u00e5 sidan <a href='/configsidebar'>Sidebar Configuration</a>.";
