    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "F\u00f6ljande tr\u00f6skeldefinition <i class=example>180/60</i> specifierar att samma fj\u00e4rrm\u00e5l till\u00e5ts g\u00f6ra 179 anslutningsf\u00f6rs\u00f6k under en 60 sekunders period. Om det g\u00f6rs ett ytterligare f\u00f6rs\u00f6k inom samma period kommer tr\u00f6skeln att \u00f6verskridas och ytterligare anslutningsf\u00f6rs\u00f6k kommer att avvisas fram till periodens slut:";
