    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Hur l\u00e4nge jobben v\u00e4ntar innan de utf\u00f6rs. Jobbk\u00f6n listas p\u00e5 sidan <a href='/jobs'>Jobs</a>. Tyv\u00e4rr finns det flera andra jobbk\u00f6er i routern som kan vara \u00f6verbelastade, och deras status \u00e4r inte tillg\u00e4nglig i routerns konsol. Jobbdr\u00f6jsm\u00e5let b\u00f6r i allm\u00e4nhet vara noll. Om det konsekvent \u00e4r h\u00f6gre \u00e4n 500 ms \u00e4r din dator mycket l\u00e5ngsam, ditt n\u00e4tverk har anslutningsproblem eller routern har allvarliga problem. <a href='/configstats#jobQueue.jobLag'>[Aktivera diagram]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Konfigurera I2P-uppdateringar";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Innan du ber\u00e4ttar f\u00f6r v\u00e4rlden om din nya webbplats b\u00f6r du l\u00e4gga till lite inneh\u00e5ll. G\u00e5 till serverns rotkatalog <a href=#rootdir>listad ovan</a> och ers\u00e4tt den <i>index.html</i> omdirigeringsidan med ditt eget inneh\u00e5ll. Om du beh\u00f6ver en mall f\u00f6r en grundl\u00e4ggande webbplats kan du g\u00e4rna anpassa <a href=http://127.0.0.1:7658/help/pagetemplate.html>den h\u00e4r sidan</a>. Om du \u00e5terv\u00e4nder till den h\u00e4r sidan efter att ha redigerat inneh\u00e5llet, f\u00f6rs\u00f6k att rensa webbl\u00e4sarens webbcache.";
