    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Detta indikerar m\u00e4ngden RAM-minne som I2P anv\u00e4nder och den totala m\u00e4ngden tillg\u00e4ngligt, som allokeras av Java. Om anv\u00e4ndningen \u00e4r konsekvent h\u00f6g i f\u00f6rh\u00e5llande till det tillg\u00e4ngliga RAM-minnet kan detta indikera att du beh\u00f6ver \u00f6ka RAM-minnet som \u00e4r tilldelat till JVM. Du kan tilldela mer RAM-minne genom att redigera din <code>wrapper.config</code>-fil som vanligtvis finns i I2P-programmets katalog. Du beh\u00f6ver redigera parametern <code>wrapper.java.maxmemory</code>, som som standard \u00e4r inst\u00e4lld p\u00e5 256 (MB) f\u00f6r I2P eller 384 f\u00f6r I2P+. Observera: om minnesf\u00e4ltet \u00e4r aktiverat kommer minnesposten i routerns informationsavsnitt att undertryckas.";
