    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "F\u00f6r att erbjuda dina egna statiska inneh\u00e5ll beh\u00f6ver du bara redigera eller byta ut filerna i webbserverns rotkatalog och webbplatsen kommer att vara tillg\u00e4nglig p\u00e5 I2P-n\u00e4tverket efter att du har f\u00f6ljt instruktionerna nedan. Dessutom kan cgi- och python-skript k\u00f6ras fr\u00e5n <code>cgi-bin</code>-katalogen omedelbart ovanf\u00f6r <code>docroot</code> om du har <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> och <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installerade.";
