    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "M\u00e5nga av statistiken i sidof\u00e4ltet kan <a href='/configstats'>konfigureras</a> f\u00f6r att skapa <a href='/graphs'>grafer</a> f\u00f6r ytterligare analys. Du kan ocks\u00e5 anpassa sektionerna som visas i sidof\u00e4ltet och deras placering p\u00e5 <a href='/configsidebar'>konfigurationssidan f\u00f6r sidof\u00e4ltet</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Denna inst\u00e4llning f\u00f6r en specifik tunnel g\u00f6r att du kan aktivera eller inaktivera svar p\u00e5 pingar som skickas till servrar som v\u00e4rd av routern. F\u00f6r att inaktivera pingar m\u00e5ste du l\u00e4gga till raden <code>i2p.streaming.answerPings=false</code> i sektionen <i>Anpassade alternativ</i> f\u00f6r serverns konfiguration i Tunnelhanteraren.";
