    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Om du vill installera osignerade (.zip) I2P-uppdateringar b\u00f6r detta l\u00e4ggas till i din <code>router.config</code>-fil om du inte redan har konfigurerat <code>routerconsole.advanced=true</code>, i vilket fall detta alternativ redan \u00e4r levererat. Notera: Fr\u00e5n och med I2P+ 0.9.48+ \u00e4r installation av <a href=/configupdate#i2pupdates>osignerade uppdateringar</a> aktiverat som standard.";
