    t[2617] = "Om du k\u00e4nner n\u00e5gon som k\u00f6r I2P och litar p\u00e5 dem, be dem skicka dig en \u00e5ters\u00e5ddsfilm som genererats med hj\u00e4lp av denna sida i deras routerkonsol. V\u00e4lj sedan alternativet <i>\u00c5ters\u00e5 fr\u00e5nfilm</i> p\u00e5 {0} med den fil du fick.";
