    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Denna inst\u00e4llning (i sekunder) g\u00f6r det m\u00f6jligt att \u00e5sidos\u00e4tta f\u00f6rdr\u00f6jningen mellan k\u00f6rningar av Peer Exploration Jobb som f\u00f6rs\u00f6ker hitta nya noder att l\u00e4gga till i NetDb. Jobbet k\u00f6rs var 80:e sekund som standard, eller om routern upplever f\u00f6rdr\u00f6jningar i behandling av jobb eller meddelanden, var 3:e minut. Om storleken p\u00e5 NetDb n\u00e5r 4000 noder, kommer pausen att \u00f6kas till 15 minuter. Du kan \u00f6ka f\u00f6rdr\u00f6jningen om din NetDb \u00e4r v\u00e4lfylld (\u00f6ver 2000 noder), eller om du vill minska den totala bandbreddsanv\u00e4ndningen. Observera: F\u00f6r Floodfill-routers k\u00f6rs inte detta jobb.";
    t[2698] = "Current";
    t[2699] = "Aktuellt";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "En webbplats som \u00e4r v\u00e4rd p\u00e5 det I2P-n\u00e4tverket. Som standard \u00e4r en <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty-webbserver</a> konfigurerad och k\u00f6rs p\u00e5 <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Kan inaktiveras eller \u00e4ndras i <a href=/i2ptunnelmgr>Tunnelhanteraren</a>. Kan \u00e4ven konfigureras f\u00f6r att binda till en specifik gr\u00e4nssnitt eller alla gr\u00e4nssnitt.";
    t[2728] = "I2P+ Service now enabled on system start";
