    t[2752] = "Same IP as us";
    t[2753] = "Samma IP som oss";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Du kan skapa en ny routerfamilj h\u00e4r. N\u00e4r du har skapat familjen kan du exportera familjenyckelfilen och dela den med andra routrar i din nominerade familj.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Tunnlar peer har tackat ja till att delta i";
    t[2758] = "Advanced Lookup";
    t[2759] = "Avancerad s\u00f6kning";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "F\u00f6r att kunna komma \u00e5t webbplatser som \u00e4r v\u00e4rdade p\u00e5 I2P, och eventuellt anv\u00e4nda standardutproxyen f\u00f6r att ansluta till webbplatser p\u00e5 clearnet, m\u00e5ste du konfigurera din webbl\u00e4sare att anv\u00e4nda I2P HTTP-proxy, som k\u00f6rs som standard p\u00e5 <code>127.0.0.1 port 4444</code>. De flesta webbl\u00e4sare erbjuder ett alternativ f\u00f6r att konfigurera din proxy; i denna miniguide fokuserar vi p\u00e5 Firefox.";
    t[2776] = "Close to us";
    t[2777] = "N\u00e4ra oss";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "I2P-router webbplatskarta";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "H\u00e4mtad insticksmodulsversion {0} \u00e4r inte nyare \u00e4n det installerade insticksmodul";
    t[2796] = "Streaming radio service";
    t[2797] = "Str\u00f6mmande radiotj\u00e4nst";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ fungerar b\u00e4st n\u00e4r du noggrant kan \u00e5terspegla hastigheten p\u00e5 din n\u00e4tverksanslutning i <a href=/config>bandbreddskonfigurationsavsnittet</a>. Som standard \u00e4r I2P+ konfigurerad med n\u00e5gra ganska konservativa v\u00e4rden som inte passar m\u00e5nga anv\u00e4ndningsfall, s\u00e5 ta dig tid att granska dessa inst\u00e4llningar och korrigera vid behov. Ju mer bandbredd du tilldelar, <i>specifikt</i> uppstr\u00f6msbandbredd, desto mer f\u00f6rdelar f\u00e5r du av n\u00e4tverket.";
    t[2810] = "Transit by Peer";
