    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "Vad man ska g\u00f6ra om I2P inte fungerar";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "Anonymitetsvarning - Inst\u00e4llningar inkluderar tunnlar med 1-hopp.";
    t[2858] = "I2P IRC Network";
    t[2859] = "I2P IRC-n\u00e4tverk";
    t[2864] = "pixels wide";
    t[2865] = "pixlar bred";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "I2P Network Protocol (I2NP) hanterar routing och blandning av meddelanden mellan routrar, samt transportval (d\u00e4r mer \u00e4n en st\u00f6ds) vid kommunikation med en peer. F\u00f6r mer information, se <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online-dokumentationen</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Gick ut {0} sedan";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Din routers status f\u00f6r att acceptera eller avvisa f\u00f6rfr\u00e5gningar fr\u00e5n andra routrar f\u00f6r att bygga en deltagartunnel genom din router. Din router kan acceptera alla f\u00f6rfr\u00e5gningar, acceptera eller avvisa en procentandel av f\u00f6rfr\u00e5gningarna, eller avvisa alla f\u00f6rfr\u00e5gningar av olika sk\u00e4l f\u00f6r att kontrollera bandbredds- och CPU-kraven och bibeh\u00e5lla kapaciteten f\u00f6r lokala klienter. <b>M\u00e4rk";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Var god och kontakta en k\u00e4nd p\u00e5litlig v\u00e4n som har en ig\u00e5ngsatt I2P-router och be om hj\u00e4lp med att \"reseda\" din I2P-router. Be dem skicka en reseed-fil som exporterats fr\u00e5n deras ig\u00e5ngsatta I2P-router. Det \u00e4r vitalt att filen utbyts \u00f6ver en s\u00e4ker kanal, t.ex. krypterad f\u00f6r att undvika extern manipulation (PGP-signera, kryptera och verifiera med en betrodd offentlig nyckel). Filen i sig \u00e4r osignerad, var d\u00e4rf\u00f6r bara filer fr\u00e5n k\u00e4nda betrodda v\u00e4nner. Importera aldrig en reseed-fil om du inte kan verifiera dess k\u00e4lla.";
    t[2916] = "Last Good Send";
    t[2917] = "Senaste bra f\u00f6rs\u00e4ndning";
    t[2918] = "Delete this value to disable";
    t[2919] = "Radera detta v\u00e4rde f\u00f6r att inaktivera";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Du kan anv\u00e4nda en inspelare i en tunnel som skriver till en fil som en annan tunnel, eller flera tunnlar, kan anv\u00e4nda f\u00f6r d\u00e4mpning. Dessa filer kan ocks\u00e5 redigeras manuellt.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "Router som k\u00f6r en icke-nativ, mjukvaruemulerad version av Java BigInteger-biblioteket";
