    t[2935] = "Peers klocksked i f\u00f6rh\u00e5llande till v\u00e5r klocka";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "En tr\u00f6skelv\u00e4rde som, om det bryts, kommer att leda till att den st\u00f6tande fj\u00e4rrdestinationen blir dokumenterad i en angiven fil";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "Detta beror vanligtvis p\u00e5 att port 7654 anv\u00e4nds av annat program. Kontrollera loggarna f\u00f6r att verifiera.";
    t[2940] = "Disabling inbound TCP";
