    t[2945] = "Nyckelring";
    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "Verifierad familj (signeringscertifikatet \u00e4r installerat och giltigt)";
    t[2954] = "Router info not available";
    t[2955] = "Routerinformation \u00e4r inte tillg\u00e4nglig";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Java -webbapplikationer som listas nedan startas av WebConsole -klienten och k\u00f6rs i samma JVM som routern. De \u00e4r vanligtvis webbapplikationer tillg\u00e4ngliga via routernkonsolen. De kan vara kompletta applikationer (t.ex. i2psnark), fronten till en annan klient eller applikation som m\u00e5ste vara separat aktiverad (t.ex. Susidns, i2ptunnel) eller har inget webbgr\u00e4nssnitt alls (t.ex. adressbok).";
