    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Du kan \u00e5sidos\u00e4tta <a href=http://127.0.0.1:7658/help/images/>standardutseendet</a> f\u00f6r katalog\u00f6versikten genom att tillhandah\u00e5lla en redigerad <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a>-fil f\u00f6r att st\u00e4lla in ett globalt utseende. Observera att denna fil inte visas i webbserverns katalog\u00f6versikt. Filer och kataloger med prefix . och filer som heter favicon.ico eller filer som avslutas med ~ eller .bak eller .old kommer ocks\u00e5 att d\u00f6ljas fr\u00e5n visning (men fortfarande vara tillg\u00e4ngliga). Observera: F\u00f6r att skapa dolda filer med ett .-prefix p\u00e5 Windows, l\u00e4gg till ett punktum efter filen eller katalogen t.ex. <code>.dold.</code>; Utforskaren i Windows sparar d\u00e5 filen med r\u00e4tt namn och tar bort det sista punktumet i processen.";
