    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "En variant av onion-routing som krypterar flera meddelanden tillsammans f\u00f6r att g\u00f6ra det sv\u00e5rare f\u00f6r angripare att utf\u00f6ra trafikanalys och f\u00f6r att \u00f6ka hastigheten p\u00e5 datatransfer. F\u00f6r mer information, se <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online-dokumentationen</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Hur du st\u00e4rker s\u00e4kerheten i din WordPress-webbplats";
    t[3496] = "I2P Internals";
    t[3497] = "I2P internt";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Som standard levereras I2P med en webbserver f\u00f6r att vara v\u00e4rd f\u00f6r din egen anonymiserade webbplats (traditionellt kallad en <i>eepsite</i>). B\u00e5de webbplatsen och I2P-routerkonsolen k\u00f6rs p\u00e5 en specialversion av <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, anpassad f\u00f6r I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Denna inst\u00e4llning g\u00f6r det m\u00f6jligt att utesluta \u00e4ldre routrar fr\u00e5n din NetDb. Routrar \u00e4ldre \u00e4n standardv\u00e4rdet eller det v\u00e4rde du st\u00e4ller in kommer att tas bort fr\u00e5n NetDb och bli f\u00f6rbjudna under routerns session. Som standard undantas routrar som \u00e4r \u00e4ldre \u00e4n 0.9.20. Obs: fr\u00e5n och med I2P+ version 0.9.46+ anv\u00e4nds endast routrar som k\u00f6r mycket senare versioner f\u00f6r att bygga lokala tunnlar. [Omstart kr\u00e4vs]";
