    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "De routerkonfigurationsalternativ som listas nedan \u00e4r inte tillg\u00e4ngliga i anv\u00e4ndargr\u00e4nssnittet, vanligtvis eftersom de s\u00e4llan anv\u00e4nds eller ger \u00e5tkomst till avancerade inst\u00e4llningar som de flesta anv\u00e4ndare inte beh\u00f6ver. Detta \u00e4r inte en helt\u00e4ckande lista. Vissa inst\u00e4llningar kr\u00e4ver en omstart av routern f\u00f6r att ta effekt. Observera att alla inst\u00e4llningar skiftl\u00e4gesk\u00e4nsliga. Du kommer att beh\u00f6va redigera din <code>router.config</code> -fil f\u00f6r att l\u00e4gga till alternativ, eller, n\u00e4r du har lagt till <code>routerconsole.advanced=true</code> i router.config-filen, kan du redigera inst\u00e4llningar i konsolen p\u00e5 <a href=/configadvanced>Avancerad konfiguration sida</a>.";
