    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Vissa IRC-klienter \u00e4r konfigurerade att koppla fr\u00e5n servern om det inte har skett n\u00e5gon kommunikation med servern under en viss tid, vilket ibland kan vara problematiskt f\u00f6r I2P IRC om v\u00e4rdet f\u00f6r <i>ping timeout</i> \u00e4r f\u00f6r l\u00e5gt. Genom att st\u00e4lla in v\u00e4rdet f\u00f6r ping timeout i din klient till ett h\u00f6gt v\u00e4rde (t.ex. 320 sekunder) leder oftast till en mer stabil anslutning till n\u00e4tverket. I HexChat kan du konfigurera v\u00e4rdet genom att skriva <code>/set net_ping_timeout 320</code>. Detta kommer att skriva v\u00e4rdet till din <code>hexchat.conf</code>-fil.";
    t[3964] = "Run at Startup?";
    t[3965] = "K\u00f6r vid uppstart?";
    t[3972] = "Never";
    t[3973] = "Aldrig";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "En <a href=/confignet#ipchange>valfri konfiguration</a> som automatiskt \u00e4ndrar din <a href=/netdb?r=.>router-identitet</a> och <a href=/confignet#udpconfig>extern port</a> n\u00e4r den offentliga IP-adressen f\u00f6r systemet \u00e4ndras. Detta kan f\u00f6rhindra en motst\u00e5ndare fr\u00e5n att korrelera din router-identitet och IP-adress i scenarier d\u00e4r din IP-adress kan \u00e4ndras ofta, till exempel n\u00e4r du k\u00f6r I2P p\u00e5 en b\u00e4rbar dator fr\u00e5n flera platser.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "Routern \u00e4r inte konfigurerad f\u00f6r att offentligg\u00f6ra dess adress, d\u00e4rf\u00f6rf\u00f6rv\u00e4ntar den inte inkommande anslutningar.";
