    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Notera: Deklarationens ordning spelar roll. Den f\u00f6rsta gr\u00e4nsv\u00e4rdet deklarationen f\u00f6r en given destination (oavsett om den \u00e4r explicit eller listad i en refererad fil) \u00e5sidos\u00e4tter alla framtida gr\u00e4nsv\u00e4rden f\u00f6r samma destination, oavsett om de \u00e4r explicita eller listade i en fil. Notera: F\u00f6r att till\u00e4mpa en ny filterfil m\u00e5ste tunneln startas om efter att platsen har angetts i tunnelhanteraren. N\u00e4r konfigurationen \u00e4r klar kan en definitionsfil uppdateras utan att m\u00e5l-tunneln beh\u00f6ver startas om, \u00e4ven om blockade destinationer kommer att best\u00e5 tills tunneln startas om.";
