    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "Denna inst\u00e4llning, n\u00e4r den konfigureras med en s\u00f6kv\u00e4g som pekar p\u00e5 en giltig blocklist-fil, g\u00f6r det m\u00f6jligt att ladda en ytterligare, anv\u00e4ndarkonfigurerad blocklista vid routerstart. [Inaktiverad som standard, omstart kr\u00e4vs]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ st\u00f6der anpassade tema\u00f6verlagringar f\u00f6r konsolen, tunnelhanteraren, I2PSnark, SusiDNS och Susimail, vilket g\u00f6r det m\u00f6jligt att \u00e4ndra teman som \u00e4r best\u00e5ende efter uppgraderingar. F\u00f6r att aktivera en \u00f6verlagring, skapa en css-fil som heter <code>override.css</code> med dina temamodifikationer och placera den i den relevanta temakatalogen f\u00f6r det tema du vill \u00e4ndra, eller byt namn p\u00e5 en av exempelfilerna och uppdatera sedan sidan manuellt i webbl\u00e4saren. Observera att tunnelhanteraren och konsolen delar samma override.css. F\u00f6r att inaktivera en \u00f6verlagring, radera eller byt namn p\u00e5 filen <code>override.css</code> och uppdatera sedan sidan manuellt i webbl\u00e4saren (vanligtvis Kontroll + Skift + R).";
