    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Om efter n\u00e5gra minuter av upptid din router indikerar 0 aktiva peers och 0 k\u00e4nda peers, med en avisering i sidof\u00e4ltet att du beh\u00f6ver kontrollera din n\u00e4tverksanslutning, verifiera att du kan komma \u00e5t internet. Om din internetanslutning \u00e4r funktionsduglig kan du beh\u00f6va avblockera Java i din brandv\u00e4gg. Annars kan du beh\u00f6va \u00e5ters\u00e5 din I2P-router. G\u00e5 till <a href=/configreseed#reseedconfig>Reseed Configuration-sidan</a> och klicka p\u00e5 knappen <i>Spara \u00e4ndringar och \u00e5ters\u00e5 nu</i>. F\u00f6r mer information, se avsnittet <a href=#reseedhelp>Reseed hj\u00e4lp</a> ovan.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "En h\u00f6gre niv\u00e5 sockets-API f\u00f6r klienter. \u00d6ppnas endast n\u00e4r en SAM V3-klient beg\u00e4r en UDP-session. Kan aktiveras/inaktiveras p\u00e5 <a href=/configclients>Sida f\u00f6r klientkonfiguration</a>. Kan \u00e4ndras i <code>clients.config</code>-filen med SAM-kommandoradsalternativet <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Om du vill att din webbplats ska k\u00e4nnas responsiv \u00e4r bildkomprimering viktig n\u00e4r du hostar stora bilder. Genom att anv\u00e4nda en tj\u00e4nst som <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> f\u00f6r att komprimera dina png- och jpeg-bilder resulterar ofta i mycket mindre filer med minimal f\u00f6rlust av kvalitet. I vissa situationer kan webp-formatet vara b\u00e4ttre \u00e4n jpeg och generera mindre filer med ungef\u00e4r samma eller b\u00e4ttre visuell kvalitet, och har ett brett st\u00f6d i webbl\u00e4sare. \u00d6verv\u00e4g ocks\u00e5 att anv\u00e4nda svg ist\u00e4llet f\u00f6r bitmapbilder f\u00f6r ikoner och illustrationer - de \u00e4r oftast mindre \u00e4n motsvarande bitmapfil (k\u00f6r dem genom en tj\u00e4nst som <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> f\u00f6r att ta bort on\u00f6dig skr\u00e4p), skalas utan f\u00f6rlust av kvalitet och kan komprimeras av din webbserver.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP \u00e4r avaktiverad p\u00e5 denna enheten";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Som standard kommer de flesta av dina klienttj\u00e4nster (mail, http-proxy, IRC) att anv\u00e4nda samma upps\u00e4ttning tunnlar (av prestandask\u00e4l) och listas som <i>Dela klienter</i> och <i>Dela klienter (DSA)</i> i sidof\u00e4ltet under Tj\u00e4nsttunnlar och p\u00e5 <a href=/tunnels>Tunnelsidan</a>.";
