    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Den h\u00e4r inst\u00e4llningen (i millisekunder) g\u00f6r det m\u00f6jligt att manuellt konfigurera pausen mellan uppdateringarna av routern som k\u00f6rs av Refresh Routers Job. Som standard avg\u00f6rs pausen mellan uppdateringarna av storleken p\u00e5 NetDb och introducerar viss slumpm\u00e4ssighet i tidpunkterna f\u00f6r att motverka trafikanalys. F\u00f6r v\u00e4rden l\u00e4gre \u00e4n 2000 millisekunder rekommenderas det att \u00f6ka v\u00e4rdet p\u00e5 <code>router.refreshTimeout</code>. Observera att att s\u00e4tta v\u00e4rdet under 2000 millisekunder kommer att \u00f6ka n\u00e4tverkstrafiken och kan leda till f\u00f6rsenader i jobbet, och rekommenderas inte f\u00f6r kontinuerlig anv\u00e4ndning.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Servertunnlar, konfigurerbara i <a href=/i2ptunnelmgr>Tunnel Manager</a>, erbjuder flera s\u00e4tt att begr\u00e4nsa \u00e5tkomsten till den v\u00e4rdade tj\u00e4nsten. Whitelisting av destination, blacklisting, anslutningsd\u00e4mpning och tunnelfiltrering \u00e4r metoder som tillhandah\u00e5lls f\u00f6r att motverka denial of service-attacker, ge exklusiv \u00e5tkomst till k\u00e4nda I2P-destinationer och hantera trafiken till servern.";
