    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "Avsl\u00f6ja inte denna fil f\u00f6r ok\u00e4nda anv\u00e4ndare, eftersom den inneh\u00e5ller k\u00e4nslig data (100 RouterInfo filer) fr\u00e5n din egen I2P-router som potentiellt kan anv\u00e4ndas av en motst\u00e5ndare f\u00f6r att avsl\u00f6ja din identitet. F\u00f6r att skydda din anonymitet b\u00f6r du v\u00e4nta n\u00e5gra timmar/dagar innan du delar filen med din betrodda v\u00e4n. Det \u00e4r ocks\u00e5 l\u00e4mpligt att anv\u00e4nda detta f\u00f6rfarande sparsamt (h\u00f6gst en g\u00e5ng i veckan).";
