    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "Denna inst\u00e4llning best\u00e4mmer antalet noder att utforska samtidigt n\u00e4r motsvarande Peer Exploration Job k\u00f6rs [standrad \u00e4r 1 nod i taget n\u00e4r fler \u00e4n 3000 noder \u00e4r k\u00e4nda]. Observera att att \u00f6ka detta v\u00e4rde kommer att \u00f6ka bandbreddsbehovet f\u00f6r utforskningen och att s\u00e4tta detta v\u00e4rde f\u00f6r h\u00f6gt kan orsaka \u00f6verdriven meddelandef\u00f6rdr\u00f6jning och p\u00e5verka andra tj\u00e4nster, s\u00e5 anv\u00e4nd med f\u00f6rsiktighet!";
