    t[6377] = "Om avvikelsen \u00e4r mer \u00e4n n\u00e5gra sekunder, korrigera problemet genom att justera din dators tid.";
    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Observation: F\u00f6r att f\u00f6rb\u00e4ttra din s\u00e4kerhet n\u00e4r du surfar p\u00e5 .i2p webbsidor kan du \u00f6verv\u00e4ga att installera till\u00e4gg som hindrar Javascript fr\u00e5n att k\u00f6ras i webbl\u00e4saren, som till exempel <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>. Det rekommenderas dock att du godk\u00e4nner adressen I2P+ k\u00f6rs p\u00e5 f\u00f6r att m\u00f6jligg\u00f6ra olika routerkonsol f\u00f6rb\u00e4ttringar. Dessutom rekommenderas att du installerar ett till\u00e4gg som f\u00f6rhindrar f\u00f6rfr\u00e5gningar till andra webbplatser, till exempel <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
