    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ kan vara l\u00e5ngsam att integrera i n\u00e4tverket f\u00f6rsta g\u00e5ngen du k\u00f6r det eftersom det startar upp i n\u00e4tverket och l\u00e4r sig om ytterligare knutpunkter. Ju l\u00e4ngre din I2P+ - router k\u00f6rs, desto b\u00e4ttre presterar den, s\u00e5 f\u00f6rs\u00f6k att h\u00e5lla din router ig\u00e5ng s\u00e5 l\u00e4nge som m\u00f6jligt, 24/7 om m\u00f6jligt! Om ditt <i>Active: [connected/recent]</i> antal fortfarande har f\u00e4rre \u00e4n 10 knutpunkter sedan 30 minuter, eller om ditt totala antal <i>Integrated</i> knutpunkter \u00e4r f\u00e4rre \u00e4n 5, finns det flera saker du kan g\u00f6ra f\u00f6r att kontrollera eventuella problem:";
