    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "En javainstallation av en Tor-klient, tillg\u00e4nglig som ett I2P-till\u00e4gg. Kan anv\u00e4ndas som standard <i>outproxy</i> om den \u00e4r konfigurerad i relevant SOCKS- eller HTTP-klienttunnel i <i>Tunnel Manager</i>. Tillg\u00e4nglig fr\u00e5n <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. K\u00e4llkoden finns tillg\u00e4nglig p\u00e5 <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4 adresser";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Detta avsnitt visar dina genomsnittliga bandbreddshastigheter och total anv\u00e4ndning f\u00f6r sessionen. Alla v\u00e4rden anges i byte per sekund. Du kan \u00e4ndra dina bandbreddsgr\u00e4nser p\u00e5 <a href='/config'>Sidan f\u00f6r bandbreddskonfiguration</a>. Ju mer bandbredd du g\u00f6r tillg\u00e4nglig, desto mer hj\u00e4lper du n\u00e4tverket och f\u00f6rb\u00e4ttrar din egen anonymitet, s\u00e5 ta dig tid att granska inst\u00e4llningarna. Om du \u00e4r os\u00e4ker p\u00e5 n\u00e4tverkets hastighet kan du anv\u00e4nda en tj\u00e4nst som <a href='http://speedtest.net/'>SpeedTest</a> eller liknande f\u00f6r att f\u00e5 en bra indikation p\u00e5 din bandbreddskapacitet. Din andel av uppl\u00e4nken (KBps Ut) kommer att avg\u00f6ra ditt totala bidrag till n\u00e4tverket. Bandbredd visas som <a href='/graphs'>graf</a> som standard.";
