    t[7023] = "Denna inst\u00e4llning (i millisekunder) g\u00f6r att du manuellt kan konfigurera m\u00e5lv\u00e4rdet f\u00f6r k\u00f6f\u00f6rdr\u00f6jning f\u00f6r CoDel-k\u00f6hanteringssystemet. Standardv\u00e4rdet \u00e4r 50 ms. [Omstart kr\u00e4vs]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "F\u00f6r att uppr\u00e4tth\u00e5lla anonymitet rekommenderas det att uppdatera med I2P HTTP -proxy. Om nyheterna eller i2p -uppdateringen \u00e4r v\u00e4rd p\u00e5 i2p kommer att anv\u00e4nda proxy att vara n\u00f6dv\u00e4ndig.";
