    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "I2P Client Protocol (I2CP) g\u00f6r det m\u00f6jligt f\u00f6r externa applikationer (klienter) att kommunicera med I2P via enkel TCP socket, som standard med port 7654. F\u00f6r mer information, se <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online-dokumentationen</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "K\u00f6total";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Denna inst\u00e4llning avg\u00f6r vilket transportmedel som f\u00e5r f\u00f6retr\u00e4de vid kommunikation med peers. Som standard f\u00f6redras NTCP framf\u00f6r UDP (SSU). Genom att s\u00e4tta v\u00e4rdet till true kommer UDP att f\u00e5 f\u00f6retr\u00e4de om ingen befintlig NTCP-anslutning finns; n\u00e4r v\u00e4rdet \u00e4r satt till always kommer UDP alltid att anv\u00e4ndas oavsett eventuell befintlig NTCP-anslutning. [Standard \u00e4r false]";
