    t[7309] = "Endast IPv6 SSU, introducerade";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) \u00e4r en I2P-n\u00e4tverkstransport som ger krypterade, anslutningsorienterade, punkt-till-punkt-anslutningar, samt IP-adressdetektering och NAT-traverseringstj\u00e4nster. F\u00f6r mer information, se den <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online-dokumentationen</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Tr\u00e4ngself\u00f6nster";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Anv\u00e4nd proxy f\u00f6r att \u00e5terseed";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Fram till inf\u00f6randet av I2P-integrationen i <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a> var det inte m\u00f6jligt att ladda ner torrents som inte var v\u00e4rd f\u00f6r I2P-n\u00e4tverket. Men nu n\u00e4r Vuze (och nyligen <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) till\u00e5ter anv\u00e4ndare att dela icke-I2P-torrents p\u00e5 I2P, kan icke-I2P-torrents laddas ner \u00f6ver I2P om Vuze/Bigly-anv\u00e4ndare har valt att g\u00f6ra inneh\u00e5llet tillg\u00e4ngligt f\u00f6r I2P-n\u00e4tverket. Popul\u00e4ra torrents med m\u00e5nga peers \u00e4r mer troliga att vara tillg\u00e4ngliga via I2P. F\u00f6r att ta reda p\u00e5 om inneh\u00e5llet \u00e4r tillg\u00e4ngligt, l\u00e4gg till torrentl\u00e4nken, magneten eller infohashen till din I2P-aktiverade BitTorrent-klient.";
