    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Om en <i>Registreringsautentisering</i>-str\u00e4ng beg\u00e4rs, kan du hitta den p\u00e5 <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registreringsautentiseringssidan</a> l\u00e4nkad fr\u00e5n <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Konfigurationssidan f\u00f6r tunnelhanteraren</a>. Registreringsautentisering s\u00e4kerst\u00e4ller att endast \u00e4garen kan registrera eller p\u00e5 annat s\u00e4tt hantera v\u00e4rdnamnet och kr\u00e4vs f\u00f6r stats.i2p och reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Nyheter &amp; uppdateringar";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Om du inte kan starta routern med <code>i2p/i2prouter start</code>, prova med skriptet <code>runplain.sh</code> i samma katalog. Root-r\u00e4ttigheter kr\u00e4vs aldrig f\u00f6r att k\u00f6ra I2P+. Om du beh\u00f6ver kompilera <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi-biblioteket</a> (vilket \u00e4r n\u00f6dv\u00e4ndigt i s\u00e4llsynta fall), konsultera dokumentationen, bes\u00f6k forumen eller bes\u00f6k <a href=irc://127.0.0.1:6668/saltR class=chatlink>I2P+-kanalen</a> eller <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC-utvecklar-kanalen</a>.";
