    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "Definiera det maximala antalet parallella <a href=/jobs>uppgifter</a> som kan k\u00f6ras. Standardv\u00e4rdet best\u00e4ms av m\u00e4ngden minne som allokeras till JVM via <code>wrapper.config</code>, och \u00e4r inst\u00e4llt p\u00e5 3 f\u00f6r mindre \u00e4n 64 MB, 4 f\u00f6r mindre \u00e4n 256 MB eller 5 f\u00f6r mer \u00e4n 256 MB. Observera: En \u00e4ndring av denna inst\u00e4llning kr\u00e4ver en omstart av routern.";
