    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Om m\u00f6jligt b\u00f6r multimediainneh\u00e5ll som anv\u00e4nds igen p\u00e5 din webbplats laddas fr\u00e5n en extern fil och inte inlinas. Om du anv\u00e4nder samma CSS p\u00e5 flera sidor, skapa en separat CSS-fil och ladda in den i <code>&lt;head&gt;</code>-sektionen p\u00e5 dina sidor. Detta g\u00f6r att uppdateringar av stilmallarna p\u00e5 din webbplats blir enklare att hantera och kommer \u00e4ven att till\u00e5ta att filen cachas i bes\u00f6karens webbl\u00e4sare, vilket minskar bandbreddsbelastningen p\u00e5 din webbserver och ger snabbare sidinl\u00e4sning f\u00f6r dina bes\u00f6kare.";
