    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Om du tror att du har \u00f6ppnat din brandv\u00e4gg och I2P fortfarande tror att du \u00e4r bakom en branv\u00e4gg, kom ih\u00e5g att du kan ha flera brandv\u00e4ggar, exempelvis b\u00e5deprogramvaru- och h\u00e5rdvarubrandv\u00e4ggar.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "Nyckelordet <i class=example>deny</i>. Denna tr\u00f6skel \u00f6verskrids alltid, dvs. inga anslutningsf\u00f6rs\u00f6k kommer att till\u00e5tas.";
    t[8282] = "log visitors making 90 or more connections a minute";
