    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Du har konfigurerat inkommande TCP, men dina UDP portar \u00e4r bakom en brandv\u00e4gg, och d\u00e4rf\u00f6r \u00e4r det troligt att ditt TCP portar \u00e4r bakom en brandv\u00e4gg ocks\u00e5.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Detta \u00e4r antalet grannar din router kommer att anv\u00e4nda f\u00f6r n\u00e4tverksdatabasf\u00f6rfr\u00e5gningar. Dessa \u00e4r vanligtvis <i>floodfill</i>-routers som \u00e4r ansvariga f\u00f6r att uppr\u00e4tth\u00e5lla n\u00e4tverkets integritet. Dina integrerade grannar visas l\u00e4ngst ner p\u00e5 <a href='/profiles'>Sidan f\u00f6r profiler</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Hantera routerwebbappar";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "Utg\u00e5ende TCP fr\u00e5n slumpm\u00e4ssiga h\u00f6ga portar till godtyckliga fj\u00e4rr-TCP-portar.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "N\u00e4r du startar I2P kan det ta n\u00e5gra minuter att bootstrap (integrera) din router i n\u00e4tverket och hitta ytterligare peers, s\u00e5 ha t\u00e5lamod.";
