    t[8334] = "Function";
    t[8335] = "Funktion";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "P\u00e5 I2P-n\u00e4tverket kan fj\u00e4rrhostade tj\u00e4nster n\u00e5s med hj\u00e4lp av en adress i <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> som slutar med \".b32.i2p\", ett <i>destination</i> som representeras som en l\u00e5ng <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> str\u00e4ng, eller oftast genom att anv\u00e4nda en .i2p-dom\u00e4n. En destination \u00e4r I2P:s motsvarighet till en IP-adress och visas p\u00e5 <a href='/i2ptunnel/edit?tunnel=3'>sidan f\u00f6r konfiguration av tunnelhanterare</a>. Du kan dela din b32.i2p-adress f\u00f6r att till\u00e5ta andra att komma \u00e5t din webbplats tills du har registrerat din egen .i2p-dom\u00e4n.";
