    t[8573] = "<a href=/logs>Loggar</a> kan vara till hj\u00e4lp f\u00f6r att l\u00f6sa ett problem. Du kan vilja klistra in utdrag i en <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> f\u00f6r att f\u00e5 hj\u00e4lp eller kanske <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>klistra</a> in det ist\u00e4llet och referera till l\u00e4nken p\u00e5 IRC f\u00f6r hj\u00e4lp.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Plugins som \u00e4r signerade med utvecklarens kryptografiska nyckel \u00e4r det rekommenderade formatet, men om du vill installera osignerade plugins (.zip) kan du st\u00e4lla in detta till sann. Observera att du fortfarande kan st\u00f6ta p\u00e5 problem n\u00e4r du f\u00f6rs\u00f6ker installera en osignerad plugin om utvecklaren har inkluderat ytterligare kontroller i byggprocessen.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Om du k\u00f6r en frist\u00e5ende Tor-instans lokalt kan du anv\u00e4nda den genom att konfigurera I2P f\u00f6r att anv\u00e4nda: <i>Proxytyp:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "V\u00e4lj spr\u00e5k f\u00f6r routerkonsolen och webbapplikationerna (<a href=/webmail target=_blank rel=noreferrer>webbmejl</a>, <a href=/torrents target=_blank rel=noreferrer>torrent</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnelhanterare</a> osv). Om du vill \u00e4ndra spr\u00e5ket i framtiden, \u00e4ndra routerkonsoltens tema eller konfigurera ett l\u00f6senord f\u00f6r att komma \u00e5t konsolen kan du g\u00f6ra detta p\u00e5 <a href=/configui target=_blank rel=noreferrer>konfigurationssidan f\u00f6r anv\u00e4ndargr\u00e4nssnittet</a>.";
