    t[9052] = "Ready";
    t[9053] = "Redo";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Dessa \u00e4r de lokala tj\u00e4nsterna som tillhandah\u00e5lls av din router. De kan vara klienter som startats genom <a href='/i2ptunnelmgr'>Tunnelhanteraren</a> eller externa program som ansluter genom SAM, BOB eller direkt till I2CP. Som standard delar de flesta av dina klienttj\u00e4nster (e-post, HTTP-proxy, IRC) samma upps\u00e4ttning tunnlar och listas som <i>Delade klienter</i> och <i>Delade klienter (DSA)</i>, vilket f\u00f6rb\u00e4ttrar anonymiteten genom att blanda trafiken fr\u00e5n alla delade tj\u00e4nster och minskar den \u00f6verbelastning som kr\u00e4vs f\u00f6r att bygga och underh\u00e5lla tunnlar. Men om du upplever att en tunnel misslyckas kommer alla dina tj\u00e4nster att bli offline samtidigt, s\u00e5 i vissa scenarier kan du vilja konfigurera klienttj\u00e4nsterna att anv\u00e4nda sin egen upps\u00e4ttning tunnlar. Detta kan g\u00f6ras genom att avmarkera alternativet <i>Dela tunnlar med andra klienter&hellip;</i> som finns under <i>Delade klienter</i> p\u00e5 konfigurationssidan f\u00f6r den relevanta klienttj\u00e4nsten i Tunnelhanteraren, varp\u00e5 du m\u00e5ste starta om klienttj\u00e4nsten fr\u00e5n <a href='/i2ptunnelmgr'>huvudsidan f\u00f6r Tunnelhanteraren</a>.";
