    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "En enkel CGI-applikation som tar en v\u00e4rdnamn som parameter och returnerar en 301-omdirigering till r\u00e4tt URL med en <code>?i2paddresshelper=key</code> str\u00e4ng bifogad. HTTP-proxyt kommer att tolka den bifogade str\u00e4ngen och anv\u00e4nda nyckeln som den faktiska destinationen. Dessutom kommer proxyt att cacha nyckeln s\u00e5 att adresshj\u00e4lpen inte beh\u00f6vs f\u00f6rr\u00e4n omstart, och erbjuda m\u00f6jligheten att l\u00e4gga till den l\u00f6sta adressen i adressboken.";
