    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Den h\u00e4r inst\u00e4llningen (i minuter) g\u00f6r det m\u00f6jligt att manuellt konfigurera hur l\u00e4nge du ska v\u00e4nta efter start innan RouterInfos i NetDb kontrolleras f\u00f6r att vara giltiga, efter vilket endast giltiga routrar accepteras f\u00f6r inkludering. N\u00e4r valideringen sker kommer utg\u00e5ngna RouterInfos och oresponsiva peers som bara \u00e4r tillg\u00e4ngliga via SSU att tas bort fr\u00e5n NetDb. [Standard \u00e4r 60 minuter] Observera: Den h\u00e4r inst\u00e4llningen har ingen inverkan p\u00e5 \u00e4ldre routar (som \u00e4r \u00e4ldre \u00e4n 0.9.29 som standard) som tas bort fr\u00e5n NetDb och blir f\u00f6rbjudna f\u00f6r router-sessionen s\u00e5 snart en NetDb-lagring f\u00f6rs\u00f6ks att g\u00f6ras.";
