    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Omplantering \u00e4r startmetoden som anv\u00e4nds f\u00f6r att hitta andra routrar n\u00e4r du f\u00f6rst installerar I2P, eller n\u00e4r din router har f\u00f6r f\u00e5 routerreferenser. Standardinst\u00e4llningarna fungerar f\u00f6r de flesta. \u00c4ndra dessa endast om HTTPS-blockeras av en restriktiv brandv\u00e4gg eller om omplanteringen har misslyckats.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Denna inst\u00e4llning g\u00f6r att maxv\u00e4rdet f\u00f6r den extra slumpm\u00e4ssiga pongf\u00f6rdr\u00f6jningen som inf\u00f6rs f\u00f6r ping-aktiverade servrar \u00e4ndras om <code>i2p.streaming.enablePongDelay</code> ocks\u00e5 \u00e4r aktiverad. Om den inte st\u00e4lls in kommer standardv\u00e4rdet p\u00e5 50 ms att anv\u00e4ndas.";
