    t[9466] = "This may be a transient error, if the other program is no longer using the port.";
    t[9467] = "Detta kan vara tillf\u00e4llig fel, om det andra programmet inte l\u00e4ngre anv\u00e4nder porten.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Som standard bidrar din I2P+ router till n\u00e4tverket genom att leda intern, \u00e4nd\u00e5ndpunkt-krypterad trafik f\u00f6r andra routrar, vilket kallas <i>partsagande</i>. Partsagande-bandbredden f\u00f6rb\u00e4ttrar anonymitetsniv\u00e5n f\u00f6r alla anv\u00e4ndare i n\u00e4tverket och maximerar din nedladdningshastighet.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Denna inst\u00e4llning till\u00e5ter konfiguration av alternativa NTP-servrar som kr\u00e4vs f\u00f6r att se till att din router beh\u00e5ller korrekt klocktid. [Standardv\u00e4rden \u00e4r 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimera dina bilder";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Notera att profileraren f\u00f6rlitar sig p\u00e5 uth\u00e5llig klienttunnelanv\u00e4ndning f\u00f6r att korrekt profilera peers.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Om du har br\u00e5ttom och inte kan v\u00e4nta n\u00e5gra timmar kan du be folk att anv\u00e4nda en \"jump\"-adresshj\u00e4lpretdegeringstj\u00e4nst. Detta kommer vanligtvis att fungera inom n\u00e5gra minuter efter att du har registrerat ditt v\u00e4rdnamn p\u00e5 samma sida. Testa det sj\u00e4lv f\u00f6rst genom att ange <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> i din webbl\u00e4sare. N\u00e4r det fungerar kan du ber\u00e4tta f\u00f6r andra att anv\u00e4nda det.";
