    t[9580] = "Note that the full path to the output files must be accessible before deploying the filter. If the target directory does not exist, the destinations will not be recorded and an error will appear in the router logs. The files will be created as required. The examples provided above are not recommendations; your configuration should be tuned according to the amount of content (number and size of files) your site is serving, the speed of the server, and the frequency with which the site is updated. Configuring recorders and monitoring the resulting files will help you fine tune the settings.";
    t[9581] = "Observera att den fullst\u00e4ndiga s\u00f6kv\u00e4gen till utdatafilerna m\u00e5ste vara tillg\u00e4nglig innan filteret implementeras. Om m\u00e5lkatalogen inte finns kommer destinationerna inte att spelas in och ett felmeddelande kommer att visas i routerloggen. Filerna kommer att skapas vid behov. Ovanst\u00e5ende exempel \u00e4r inte rekommendationer; din konfiguration b\u00f6r anpassas efter m\u00e4ngden inneh\u00e5ll (antal och storlek p\u00e5 filer) som din webbplats serverar, serverhastigheten och frekvensen med vilken webbplatsen uppdateras. Genom att konfigurera inspelare och \u00f6vervaka de resulterande filerna kan du finjustera inst\u00e4llningarna.";
    t[9588] = "In the Network Settings sub-section, hit the <i>Settings</i> button.";
