    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tunnlar byggda av andra routrar genom din router. Detta kan variera kraftigt beroende p\u00e5 n\u00e4tverkets efterfr\u00e5gan, din delade bandbredd och den genererade trafikm\u00e4ngden lokalt. Det rekommenderade s\u00e4ttet att begr\u00e4nsa deltagande tunnlar \u00e4r att \u00e4ndra din andelsprocent p\u00e5 <a href='/config'>Sidan f\u00f6r bandbreddskonfiguration</a>. Du kan ocks\u00e5 begr\u00e4nsa det totala antalet genom att st\u00e4lla in <code>router.maxParticipatingTunnels=nnn</code> p\u00e5 <a href='/configadvanced'>Sidans f\u00f6r avancerad konfiguration</a>. <a href='/configstats#tunnel.participatingTunnels'>[Aktivera grafik]</a>.";
