    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "En lista \u00f6ver l\u00e4nder som h\u00e4rstammar fr\u00e5n <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> med ett d\u00e5ligt rykte f\u00f6r medborgerliga friheter. Denna lista anv\u00e4nds f\u00f6r att placera routare som k\u00f6rs i de angivna l\u00e4nderna i <i>Hidden Mode</i> f\u00f6r att ge f\u00f6rb\u00e4ttrad s\u00e4kerhet f\u00f6r anv\u00e4ndarna. F\u00f6ljande l\u00e4nder betraktas som str\u00e4nga: Afghanistan, Azerbajdzjan, Bahrain, Belarus, Brunei, Burundi, Kamerun, Centralafrikanska republiken, Tchad, Kina, Kuba, Demokratiska republiken Kongo, Egypten, Ekvatorialguinea, Eritrea, Etiopien, Iran, Kazakstan, Laos, Libyen, Myanmar, Nordkorea, Palestinska territorierna, Rwanda, Saudiarabien, Somalia, Sydsudan, Sudan, Eswatini (Swaziland), Syrien, Tadzjikistan, Thailand, Turkiet, Turkmenistan, Venezuela, F\u00f6renade Arabemiraten, Uzbekistan, V\u00e4stsahara, Jemen.";
