    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Om m\u00f6jligt, se till att I2P+/Java har port\u00e5tkomst i b\u00e5da riktningarna fr\u00e5n internet genom att konfigurera ditt modem/routerns/pc-brandv\u00e4gg d\u00e4refter. Om du befinner dig bakom en restriktiv brandv\u00e4gg men har oinskr\u00e4nkt ut\u00e5tg\u00e5ende \u00e5tkomst kan I2P+ fortfarande fungera; du kan st\u00e4nga av inkommande \u00e5tkomst och f\u00f6rlita dig p\u00e5 <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP-adressdetektion</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>brandv\u00e4ggs hole punching</a>) f\u00f6r att ansluta dig till n\u00e4tverket. Din n\u00e4tverksstatus i sidopanelen kommer att ange \"Status: Firewalled\". F\u00f6r optimal prestanda, se till att I2Ps <a href=/confignet#udpconfig>externa port</a> \u00e4r synligt fr\u00e5n internet (se nedan f\u00f6r mer information).";
