    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Som standard anv\u00e4nder I2P den systemkonfigurerade standardwebbl\u00e4saren f\u00f6r att starta vid uppstart. Om du vill v\u00e4lja en annan webbl\u00e4sare m\u00e5ste du redigera din router.config-fil (eller sidan f\u00f6r <a href=/configadvanced>Avancerad konfiguration</a> om du har aktiverat avancerat konsoll\u00e4ge) och l\u00e4gga till en ny konfigurationsrad <code>routerconsole.browser=/s\u00f6kv\u00e4g/till/webbl\u00e4sare</code> eller <code>routerconsole.browser=\\s\u00f6kv\u00e4g\\till\\webbl\u00e4sare.exe</code> om du anv\u00e4nder Windows, ers\u00e4tt <code>\\s\u00f6kv\u00e4g\\till\\webbl\u00e4sare</code> med platsen f\u00f6r webbl\u00e4saren du vill anv\u00e4nda. Observera: Om s\u00f6kv\u00e4gen till din valda webbl\u00e4sare inneh\u00e5ller mellanslag, kan du beh\u00f6va s\u00e4tta s\u00f6kv\u00e4gen inom citationstecken, t.ex. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
