    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Den h\u00e4r inst\u00e4llningen (i timmar) g\u00f6r det m\u00f6jligt att manuellt konfigurera hur gammal en RouterInfo m\u00e5ste vara f\u00f6r att den ska kontrolleras av Refresh Routers Job. Som standard anpassas \u00e5ldern f\u00f6r en RouterInfo innan en uppdatering initieras utifr\u00e5n storleken p\u00e5 NetDb, det vill s\u00e4ga att \u00e5ldern \u00f6kar n\u00e4r NetDb v\u00e4xer i storlek. Ett v\u00e4rde p\u00e5 0 tvingar Router Refresh Job att kontrollera varje router i NetDb, oavsett \u00e5lder.";
