    t[11384] = "Click the <i>Start</i> button for your webserver tunnel on the <a href=/i2ptunnelmgr/>main Tunnel Manager page</a>. You should now see it listed under <i>Service Tunnels</i> on the <a href=/>Router Console</a> sidebar. A green star displayed next to the tunnel name (<i>I2P Webserver</i> by default) indicates that your website is active on the I2P network.";
    t[11385] = "Klicka p\u00e5 <i>Start</i>-knappen f\u00f6r din webserver-tunnel p\u00e5 <a href=/i2ptunnelmgr/>huvudsidan f\u00f6r Tunnel Manager</a>. Nu b\u00f6r du se att den finns med under <i>Service Tunnels</i> p\u00e5 sidopanelen f\u00f6r <a href=/>Router Console</a>. En gr\u00f6n stj\u00e4rna som visas bredvid tunnelns namn (<i>I2P Webserver</i> som standard) indikerar att din webbplats \u00e4r aktiv p\u00e5 I2P-n\u00e4tverket.";
