    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "F\u00f6r att anv\u00e4nda en enda upps\u00e4ttning tunnlar f\u00f6r flera klienttj\u00e4nster kan klienter konfigureras fr\u00e5n <i>Tunnelhanteraren</i> f\u00f6r att fungera i <i>Delt klient</i>-l\u00e4ge. Detta l\u00e4ge sparar resurser och blandar trafiken fr\u00e5n flera klienter i en enda upps\u00e4ttning tunnlar, vilket g\u00f6r trafikanalysen sv\u00e5rare. Klienter som \u00e4r konfigurerade som Delade klienter delar samma tunnelalternativ.";
