    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Din modem eller router kanske st\u00f6der <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), vilket g\u00f6r det m\u00f6jligt med automatisk port\u00f6vers\u00e4ttning. Se till att UPnP-st\u00f6d f\u00f6r I2P+ \u00e4r aktiverat p\u00e5 <a href=/confignet>konfigurationssidan</a>, f\u00f6rs\u00f6k sedan att aktivera UPnP p\u00e5 din modem/router och m\u00f6jligtvis \u00e4ven din dator. Starta om <a href=/>I2P+-routern</a>. Om det lyckas ska I2P+ rapportera \"Status: OK\" i sidopanelen n\u00e4r I2P+-routern har genomf\u00f6rt initiala anslutningstester.";
