    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Om du sv\u00e4var \u00f6ver <i>Router Info</i>-rubriken visas din f\u00f6rkortade routeridentitet (de f\u00f6rsta fyra tecknen (24 bitar) i din 44-teckens (256-bitars) Base64-routerhash). Hela hashet visas p\u00e5 din <a href='netdb?r=.'>Network Database-post</a>. Visa aldrig detta f\u00f6r n\u00e5gon, eftersom din routeridentitet unikt \u00e4r kopplad till din IP-adress i n\u00e4tverksdatabasen.";
