    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Katalog\u00f6versikter (ibland kallade virtuella kataloger) \u00e4r aktiverade som standard, s\u00e5 att du kan vara v\u00e4rd f\u00f6r filer fr\u00e5n en underkatalog till <code>docroot</code> utan att beh\u00f6va tillhandah\u00e5lla en sida med l\u00e4nkar till filerna. Du kan ocks\u00e5 erbjuda inneh\u00e5ll som finns utanf\u00f6r <code>docroot</code> genom att anv\u00e4nda en <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolisk l\u00e4nk</a> till \u00f6nskad katalog.";
