    t[12062] = "Using the <i class=example>explicit</i> directive, a threshold can be applied to a remote destination listed in the definition itself, with the option to specify custom thresholds for multiple destinations. Remote destinations can also be excluded from the default threshold using the <i class=example>allow</i> keyword, or permanently blocked using the <i class=example>deny</i> keyword:";
    t[12063] = "Med hj\u00e4lp av direktivet <i class=example>explicit</i> kan en tr\u00f6skelv\u00e4rde anv\u00e4ndas f\u00f6r en fj\u00e4rrdestination som anges i sj\u00e4lva definitionen, med m\u00f6jlighet att specificera anpassade tr\u00f6skelv\u00e4rden f\u00f6r flera destinationer. Fj\u00e4rrdestinationer kan ocks\u00e5 exkluderas fr\u00e5n standardtr\u00f6skeln med hj\u00e4lp av nyckelordet <i class=example>allow</i>, eller permanent blockeras med nyckelordet <i class=example>deny</i>.";
