    t[12199] = "V\u00e4rdnamnsregistrering";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "Om antalet k\u00e4nda noder sjunker under 50 kommer I2P att f\u00f6rs\u00f6ka seeda automatiskt. Om seedningsf\u00f6rs\u00f6ket misslyckas kommer en notifikation att visas i sidof\u00e4ltet med m\u00f6jlighet att manuellt seeda. Ett misslyckat seedningsf\u00f6rs\u00f6k kan intr\u00e4ffa om din lokala brandv\u00e4gg begr\u00e4nsar utg\u00e5ende trafik, om du har n\u00e4tverksanslutningsproblem eller om seedningsf\u00f6rfr\u00e5gan blockeras helt och h\u00e5llet.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "Alternativ integritetsfokuserad front-end f\u00f6r Reddit";
    t[12224] = "Toggle Tunnels";
    t[12225] = "V\u00e4xla Tunnlar";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "Kan inaktiveras i <code>clients.config</code>-filen. Kan ocks\u00e5 konfigureras f\u00f6r att binda till ett specifikt gr\u00e4nssnitt eller alla gr\u00e4nssnitt i <code>jetty.xml</code>-filen.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "Du kan best\u00e4mma vilka tj\u00e4nster som automatiskt startar n\u00e4r routern startar, hantera tunnelallokering f\u00f6r att optimera f\u00f6r tj\u00e4nster med h\u00f6g anv\u00e4ndning eller f\u00f6r att minimera cpu- och minnesbelastning, l\u00e4gga till server- och klienttunnlar f\u00f6r att vara v\u00e4rd eller komma \u00e5t tj\u00e4nster i n\u00e4tverket, s\u00e4tta begr\u00e4nsningar p\u00e5 \u00f6verf\u00f6ringshastighet eller tunnelfiltrering f\u00f6r dina servertunnlar och mycket mer.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "Binder till LAN-adressen. Kan \u00e4ndras med avancerad konfiguration <code>i2np.upnp.HTTPPort=nnnn</code>. Kan inaktiveras p\u00e5 <a href=/confignet>Sidan f\u00f6r n\u00e4tverkskonfiguration</a>.";
    t[12234] = "Data transferred";
    t[12235] = "Data \u00f6verf\u00f6rs";
    t[12244] = "In the box marked <i>No Proxy for</i> add the line <code>127.0.0.1,localhost</code> to ensure the I2P console and other locally hosted websites are still available.";
    t[12245] = "I rutan <i>Ingen proxy f\u00f6r</i> l\u00e4gg till raden <code>127.0.0.1,localhost</code> f\u00f6r att s\u00e4kerst\u00e4lla att I2P-konsolen och andra lokalt v\u00e4rdade webbplatser fortfarande \u00e4r tillg\u00e4ngliga.";
